TITLE:
  - Framework test for multiphase flow through rigid porous medium
  - with function coupling to 1D artery network
  - In this test-case all porofluid variables are fixed with a DBC
  - The 1D-artery network is coupled via FUNCTION6
  - Parameters are set such that we actually solve the equation
  - '-p'''' = -p for the pressure in the artery network'
  - Results are equivalent to the one obtained by ScaTra in an
  - equivalent setting
